//     return () => {
//       Router.events.off('routeChangeComplete', handleRouteChange)
//     }
    
//   }, [])
  
    return (
      <ZEITUIProvider>
          <CSSBaseline />
          <ConfigProvider  locale={esES}>
                <Component {...pageProps} />
          </ConfigProvider >
      </ZEITUIProvider>
    )
  }

  export default MyApp
